import React from "react";
import styled from "styled-components";
import Header from "../Header/Header";
const arr = [
  "기업지원금 컨설팅",
  "벤처 인증",
  "바우처사업",
  "ISO / HACCP 인증",
  "연구개발전담부서",
];
const Wrapper = styled.div``;
function Service() {
  return (
    <Wrapper>
      <header>
        <Header />
      </header>
      <nav>
        <div>
          {arr.map((item, idx) => {
            return <div key={idx}>{item}</div>;
          })}
        </div>
      </nav>
    </Wrapper>
  );
}

export default Service;
